    public static ByteArrayEntity byteArrayEntity(String content) {
        if(content == null || "".equals(content)){
            return null;
        }
        try {
            return new ByteArrayEntity(content.getBytes("UTF-8"));
        } catch (UnsupportedEncodingException e) {
            e.printStackTrace();
        }
        return null;
    }

